import React, { useState } from 'react';

function MyForm() {
  const [formData, setFormData] = useState({ campo1: '', campo2: '' });

  const handleSubmit = (e) => {
    e.preventDefault(); // Evita la recarga de la página y la adición de datos a la URL
    // Aquí puedes realizar las operaciones que desees con los datos del formulario, por ejemplo, enviar una solicitud a un servidor
  };

  const handleChange = (e) => {
    // Actualiza el estado del formulario cuando se cambian los campos
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  return (
    <form onSubmit={handleSubmit} method="POST">
      <input type="text" name="campo1" value={formData.campo1} onChange={handleChange} />
      <input type="text" name="campo2" value={formData.campo2} onChange={handleChange} />
      <button type="submit">Enviar</button>
    </form>
  );
}

export default MyForm;
